import {Route, BrowserRouter as Router, Routes, Link } from 'react-router-dom'
import Agendamento from './components/pages/agendconsul'
import Consultas from './components/pages/consultagendadas'
import Container from './components/layout/Container';

function App() {
  return (

       <Router>
          <div>
                <Link to="/">Agendar Consulta</Link>
                <Link to="/consultas">Consultas Agendadas</Link>
          </div>

           <Routes>
                  <Route path='/' element={<Agendamento />}/>
                  <Route path='/consultas' element={<Consultas />}/>

           </Routes>
        </Router>


  );
}

export default App;
